class ChessBoard():
    squareSize = 50
    # image = Image.open("knight.png")
    # image = image.resize((25, 25), Image.NEAREST)
    # icon = ImageTk.PhotoImage(image)
    
    def __init__(self, rows, columns, root):
        self.rows = rows
        self.columns = columns
        self.root = root
        self.board_status = [[0 for _ in range(self.columns)] for _ in range(self.rows)] 
        self.prevGrid = None
        self.buttonPress = 0
    
    def populateGrids(self):
        board = Frame(self.root, height=self.squareSize * self.rows, width=self.squareSize*self.columns, bg='purple', )
        board.pack()
        
        for i in range(self.rows):
            for j in range(self.columns):
                frame = tk.Frame(
                    master=board,
                    relief=tk.RAISED,
                    borderwidth=1,
                    width=self.squareSize,
                    height=self.squareSize,
                )
                frame.grid_propagate(False)
                frame.grid(row=i, column=j, sticky='nsew') 
                self.board_status[i][j] = frame
        
        button = Button(master=self.root, text="Next", command=self.fillGrids)
        button.pack(side=BOTTOM)
        
    def fillGrids(self):
        # if self.prevGrid is not None:
        #     self.board_status[self.prevGrid[0]][self.prevGrid[1]].config(text="")
        entry = example_input[self.buttonPress]
        image_label = Label(master=self.board_status[entry[0]][entry[1]], text="K")
        image_label.pack_propagate(False)
        image_label.pack()
        
        self.buttonPress += 1
        
            

    def runVisualization(self):
        self.populateGrids()

def main():
    root = tk.Tk()
    root.title("Knight's Tour Visualization")
    root.minsize(width=500, height=500)
    root.configure(background="white")
    
    chessBoard = ChessBoard(5, 8, root)
    chessBoard.runVisualization()
    
    root.mainloop()

    
if __name__ == "__main__":
    main()